import './App.css';
import { Main } from './Details/Main';
import { UserList } from './Details/UserList';
import {Routes,Route} from 'react-router-dom';
import { CreateAccount } from './Details/CreateAccount';
import { EditAccount } from './Details/EditAccount';


function App() {
  return (
    <div className="App">
      <Routes>
      <Route path='/' element={<CreateAccount/>} />
      <Route path='/user-list' element={<UserList/>} />



      </Routes>
    </div>
  );
}

export default App;
